class Solution(object):
    def findContentChildren(self, g, s):
        """
        :type g: List[int]
        :type s: List[int]
        :rtype: int
        """
        if (len(g) == 0 or len(s) == 0):
            return 0
        g = sorted(g)
        s = sorted(s)

        gi = 0
        #print "sorted : ", g[0]
        #print s
        si = self.effectiveIndex(s, g[0])
        #print "Index : ", si, " that is : ", s[si], "v/s", s[si-1]
        count = 0
        #print "comparing with gree : ", g[gi]
        while(gi < len(g) and si < len(s)):
            if (g[gi] <= s[si]):
                count = count + 1
                gi = gi + 1
                si = si + 1
            else:
                si = si + 1
        return count

    def effectiveIndex(self, s, target):
        if (s[0] >= target):
            return 0
        else:
            left = 0
            right = len(s) - 1

            while( left <= right ):
                mid = (left + right)/2
                if (s[mid] == target):
                    if (mid == 0):
                        return 0
                    else:
                        while(mid -1 >=0 and s[mid - 1] == target):
                            mid = mid - 1
                        return mid
                elif (mid > 0 and s[mid] > target and s[mid - 1 ]< target):
                    return mid
                elif (mid + 1 < len(s) and s[mid] < target and s[mid + 1] > target):
                    return mid
                elif (s[mid] > target):
                    right = mid - 1
                else:
                    left = mid + 1


